import Link from "next/link";
const Post = (props) => (
  <li>
    <Link href={`/post?title=${props.title}`}>
      <a>{props.title}</a>
    </Link>
  </li>
);

export default () => (
    <div>
    <h2>My blog</h2>
    <ul>
    <li>
    <Post title="Yet another post" />
    <Post title="Second post" />
    <Post title="Hello, world!" />
    </li>
    </ul>
    </div>
    )
